import React from "react";
import "./Navbar.css";
const Sukan = require("../img/logodukan.png");
import { FaRegUser } from "react-icons/fa";
import { FaRegHeart } from "react-icons/fa";
import { FaCartPlus } from "react-icons/fa";
import { BiPhoneCall } from "react-icons/bi";

const Navbar = () => {
  return (
    <>
      <navbar className="Navbar">
        <div className="content_left">
          <img src={Sukan} alt="Dukan_logo" />
          <input
            type="text"
            placeholder="Search Entire Store here..."
            className="SearchBar"
          />
          <button className="serBtn">Search</button>
        </div>

        <div className="content_right">
          <div className="call">
            <BiPhoneCall className="call_1" />
            <p>Call Us </p>
          </div>
          <div className="cart">
            <FaCartPlus className="call_1" />
          </div>
          <div className="fav">
            <FaRegHeart className="call_1" />
          </div>
          <div className="regi">
          <FaRegUser className="call_1" />
          </div>
        </div>
      </navbar>
    </>
  );
};

export default Navbar;
